import React, { useEffect } from 'react';
import './footer.css';
import logo from '../Image/logo.jpg';
import AOS from 'aos';
import 'aos/dist/aos.css';

function Footer() {
    useEffect(() => {
        AOS.init();
    }, []);

    return (
        <div className="footer-Box">
            <hr />
            <footer className="bg-gray-800 dark:bg-gray-900">
                <div className="mx-auto w-full max-w-screen-xl p-4 py-6 lg:py-8">
                    <div className="grid grid-cols-2 gap-8 " data-aos="fade-up">
                        <div className="mb-6 md:mb-0">
                            <img src={logo} className=" h-10 me-3 w-16" alt="FlowBite Logo" />
                            <span className="self-center text-2xl font-semibold whitespace-nowrap dark:text-white">SK-school</span>

                        </div>
                        <div className="grid grid-cols-2 gap-8 sm:gap-6 sm:grid-cols-3">
                            <div>
                             
                                  
                                    <button type="button" class="text-white bg-gradient-to-br from-purple-600 to-blue-500 hover:bg-gradient-to-bl focus:ring-4 focus:outline-none focus:ring-blue-300 dark:focus:ring-blue-800 font-medium rounded-lg text-sm px-5 py-2.5 text-center me-2 mb-2">  <a href='https://maps.app.goo.gl/JrsMdZTq9aFRL1sd8'>
                                      map
                                    </a></button>
                            </div>
                        </div>
                    </div>
                    <hr className="my-6 border-gray-200 sm:mx-auto dark:border-gray-700 lg:my-8" />
                    <div className="text-center" >
                        <span className="text-sm text-gray-500  text-center dark:text-gray-400">Â© 2023 <a href="https://flowbite.com/" className="hover:underline">SK-school</a>. All Rights Reserved.
                        </span>
                    </div>
                </div>
            </footer>
        </div>
    )
}

export default Footer
